import React, { Component } from 'react'

import {
  MDBContainer,
  MDBRow,
  MDBCol,
  MDBCard,
  MDBCardBody,
  MDBModalFooter,
  MDBIcon,
  MDBCardHeader,
  MDBBtn,
  MDBInput, FormPage
} from "mdbreact";
import { Formik, Form, Field } from 'formik';
import * as Yup from 'yup';

const SignupSchema = Yup.object().shape({
  firstName: Yup.string()
    .min(2, 'Too Short!')
    .max(50, 'Too Long!')
    .required('Required'),
  lastName: Yup.string()
    .min(2, 'Too Short!')
    .max(50, 'Too Long!')
    .required('Required'),
  email: Yup.string().email('Invalid email').required('Required'),
});

class CSSNavPage extends Component {
  constructor(props) {
    super(props);
    this.state = {
    
      logo:'',
      name: '',
      id: '',
      welcome_message:''
    };
    
  }
  componentDidMount() {
     // get all entities - GET
     fetch("192.168.1.107:8000/schools/teq", {
      "method": "GET",
      "headers": {
        "x-rapidapi-host": "zacampus.net/sc/url",
        "x-rapidapi-key": "secret"
      }
    })
    .then(response => response.json())
    .then(response => {
      this.setState({
        friends: response
      })
    })
    .catch(err => { console.log(err); 
    });
   }
  render() {
   

  return (
    <div>
    <h1>Signup</h1>
    <Formik
      initialValues={{
        firstName: '',
        lastName: '',
        email: '',
      }}
      validationSchema={SignupSchema}
      onSubmit={values => {
        // same shape as initial values
        console.log(values);
      }}
    >
      {({ errors, touched }) => (
        <Form>
          <Field name="firstName" />
          {errors.firstName && touched.firstName ? (
            <div>{errors.firstName}</div>
          ) : null}
          <Field name="lastName" />
          {errors.lastName && touched.lastName ? (
            <div>{errors.lastName}</div>
          ) : null}
          <Field name="email" type="email" />
          {errors.email && touched.email ? <div>{errors.email}</div> : null}
          <button type="submit">Submit</button>
        </Form>
      )}
    </Formik>
  </div>
  );
}};

export default  CSSNavPage  ;
